import React from 'react';
import background from '../../../../assets/images/pokeIngredients/emptyBowl6.jpg';
import classes from './Bowl.module.css';
const emptyBowl=()=>(
<div className={classes.Bowl}>
    <img src={background} alt="EmptyBowl"/>
</div>
);

export default emptyBowl;
